import { createStore, applyMiddleware } from 'redux';
import thunk from 'redux-thunk'
import reduxSaga from 'redux-saga';

function reducers() {
    return {
        testing: ''
    };
}

export default () => {
    return {
        ...createStore(reducers, applyMiddleware(thunk))
    };
};
